window.bookSummaryJSON = "<p>Jeannine appeared in the room across from Mary. Her face was streaked with tears and she was visibly trembling. “Mary, I remembered,” she cried. “I remembered and it was awful.” </p> <p>The time has finally come for Mary to investigate Jeannine’s murder. As all clues point to someone in Bradley’s old neighborhood, Mary and Ian move into the former Alden residence and pose as newlyweds to set Mary up as bait for the killer. With Stanley and Rosie at their side, they expose the darkness hidden in the depths of Bradley’s old neighborhood. </p>"; 
